import loginImage from "../images/test.jpg";
import styled from 'styled-components'
import {MdArrowForward, MdKeyboardArrowRight} from 'react-icons/md'
import {Link} from 'react-router-dom'

export const MainContainerC = styled.div`
    margin: 0 auto;

`

export const MainWrapper = styled.div`
    display: grid;
    position: absolute;
    top : -160px;
    z-index: 1;
    height: calc (0.311526 * 100vh + 30);
    width: 100%;
    margin-left: auto;
    margin-right: auto;
    margin-bottom: 100px;
    justify-content: center;

    @media screen and (max-width: 768px) {
        top : -100px;
    }

`
export const ImgWrap = styled.div`
    height: calc (0.311526 * 100vh + 30);
    display: flex;
    justify-content: center;

`

export const Img = styled.img`
  width: 100%;
  margin: 0 0 0px 0;
  padding-right: 0;
  border-radius: 50%;
`

const ProfilPictures = () => {

    return (
        <MainContainerC>
            <MainWrapper>
                <ImgWrap>
                    <Img src={require("../images/evanhays.jpg").default} alt='profil'></Img>
                </ImgWrap>
            </MainWrapper>
        </MainContainerC>


    );
};

export default ProfilPictures;
